function I = fcnK6E(S, T, u, alpha, F, tol)
t3 = F .^ 2;t6 = sqrt(t3 .* S + u);t7 = 0.1e1 ./ t6;t9 = sqrt(S);t14 = log(F .* t9 + t6);t17 = 0.1e1 ./ u;t21 = alpha .^ 2;t22 = S .* alpha;t23 = -t22 + u;t24 = 0.1e1 ./ t23;t25 = t24 .* t21;t26 = sqrt(-alpha);t27 = F - t26;t28 = 0.1e1 ./ t27;t29 = t27 .^ 2;t31 = t26 .* S;t32 = t27 .* t31;t35 = sqrt(t29 .* S - t22 + 0.2e1 .* t32 + u);t36 = 0.1e1 ./ t35;t40 = S .* t21;t41 = t23 .^ 2;t42 = 0.1e1 ./ t41;t43 = t42 .* t26;t48 = S .^ 2;t50 = t42 .* t48 .* t21 .* alpha;t55 = sqrt(t23);t58 = 0.1e1 ./ t55 ./ t41 .* t26;t62 = log(0.2e1 .* t28 .* (t35 .* t55 - t22 + t32 + u));t66 = t17 .* t25;t71 = F + t26;t72 = 0.1e1 ./ t71;t73 = t71 .^ 2;t75 = t71 .* t31;t78 = sqrt(t73 .* S - t22 - 0.2e1 .* t75 + u);t79 = 0.1e1 ./ t78;t93 = log(0.2e1 .* t72 .* (t78 .* t55 - t22 - t75 + u));t102 = 0.1e1 ./ t26 .* t21;t107 = 0.1e1 ./ t55 ./ t23;t117 = -t7 ./ S .* F + t14 ./ t9 ./ S - 0.2e1 .* t7 .* t17 .* alpha .* F - t36 .* t28 .* t25 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t36 .* t43 .* t40 - 0.3e1 ./ 0.4e1 .* F .* t36 .* t17 .* t50 + 0.3e1 ./ 0.4e1 .* t62 .* t58 .* t40 - 0.7e1 ./ 0.4e1 .* F .* S .* t36 .* t66 - t79 .* t72 .* t25 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t79 .* t43 .* t40 - 0.3e1 ./ 0.4e1 .* F .* t79 .* t17 .* t50 - 0.3e1 ./ 0.4e1 .* t93 .* t58 .* t40 - 0.7e1 ./ 0.4e1 .* F .* S .* t79 .* t66 + 0.5e1 ./ 0.4e1 .* t36 .* t24 .* t102 - 0.5e1 ./ 0.4e1 .* t62 .* t107 .* t102 - 0.5e1 ./ 0.4e1 .* t79 .* t24 .* t102 + 0.5e1 ./ 0.4e1 .* t93 .* t107 .* t102;
